import React, { useEffect } from "react";
import Parallax from 'parallax-js'
import Planet from "./elements/Planet";
import MainPng from '../assets/img/mainImg.png'
import { startStars } from "../constants/stars";



export default function Main() {

    useEffect(() => {
        let scene = document.getElementById('scene');
        let parallaxInstance = new Parallax(scene);
    }, [])
    useEffect(() => {
        startStars()
    }, [])
    return (
        <section className='main section'>

            <div id="particle-container"></div>
            <div className="header">
                <img src={MainPng} alt="" />
            </div>
            <div className="description mx-auto">
                <h2 className='text text-right text-yellow mb-4'>
                    с 22 ноября до 19 декабря
                </h2>
                <h3 className='text text-left text-yellow'>
                    собери полную коллекцию Героев
                </h3>
            </div>
            <div className="planet-container" >
                <Planet />
            </div>
            <div id="scene">
                <div className='wave' data-depth="1.6"></div>
                <div className='wave' data-depth="0.3"></div>
            </div>


        </section>
    )
}
